The tech sector underwent rapid manpower growth, and recently, rapid reduction [1,2,3].<p>What advice do you have for new grads in CS&#x2F;EE fields looking for jobs? For example, I am finishing my PhD in AI-related work this spring. Colleagues I&#x27;ve talked to in several companies have told me about frozen hiring. Is this true in your experience?<p>Is it better to get <i>any</i> job than keep searching for the job I&#x27;d be most suited for? Should I reach directly to managers in different teams? Who are the best people&#x2F;kinds of firms to reach out to when the industry is slowing hiring?<p>[1]: https:&#x2F;&#x2F;layoffs.fyi&#x2F;
[2]: https:&#x2F;&#x2F;news.stanford.edu&#x2F;2022&#x2F;12&#x2F;05&#x2F;explains-recent-tech-layoffs-worried&#x2F;
[3]: https:&#x2F;&#x2F;www.cnbc.com&#x2F;2023&#x2F;01&#x2F;05&#x2F;tech-jobs-hit-the-hardest-by-layoffs-last-year-report.html
